INSERT INTO `dynarc_gnujikoalerts_items` VALUES('1','1','0','444','2','0','0','Dimensione file troppo grande','<p>La dimensione del file eccede il limite massimo imposto nella configurazione del php.ini</p><p>La maggior parte dei sistemi PHP settano come predefinito il parametro upload_max_filesize attorno ai 2 o 4 MB.<br />Per ovviare al problema ci sono 2 soluzioni:</p><ol><li>Se si &egrave; amministratori di sistema e si ha accesso al file di configurazione di PHP&nbsp;nel server &egrave; possibile settare il<br />parametro upload_max_filesize alla dimensione che si vuole. (ad esempio:&nbsp;100MB)</li><li>Se  si ha accesso FTP&nbsp;al server, oppure se si ha l&lsquo;accesso diretto (es. se  avete installato Gnujiko sul vostro computer) &egrave; possibile caricare nella  propria cartella home il file da uploadare.</li></ol>','','1','0','2010-11-13 15:54:00','0000-00-00 00:00:00','0',',1,2,','dimensione_file_troppo_grande','1','1.1.1','','');
INSERT INTO `dynarc_gnujikoalerts_items` VALUES('2','1','0','444','2','0','0','Dimensione file non consentita','<p>Simile all&lsquo;errore 1.1 - Dimensione file troppo grande,</p><p>ma in  questo caso il problema non &egrave; da attribuire alla configurazione PHP, ma  bens&igrave; il limite &egrave; stato imposto dallo sviluppatore dell&lsquo;applicazione.<br />La  soluzione in questo caso &egrave; contattare direttamente il programmatore che  ha sviluppato l&lsquo;applicazione in questione o il responsabile del  pacchetto.</p>','','2','0','2010-11-13 16:10:00','0000-00-00 00:00:00','0',',1,2,','dimensione_file_non_consentita','2','1.1.2','','');
INSERT INTO `dynarc_gnujikoalerts_items` VALUES('3','1','0','444','2','0','0','Il file è stato solo parzialmente caricato','<p>La causa potrebbe derivare dal poco spazio disponibile su disco.<br />Contattare l&lsquo;amministratore di sistema.</p>','','3','0','2010-11-13 16:14:00','0000-00-00 00:00:00','0',',1,2,','il_file_e_solo_parzialmente_caricato','3','1.1.3','','');
INSERT INTO `dynarc_gnujikoalerts_items` VALUES('4','1','0','444','2','0','0','Nessun file è stato caricato','<p>Potrebbe essere un bug dell&lsquo;applicazione in quanto questo tipo di errore raramente si manifesta.<br />In  sostanza il sistema si aspetta che voi carichiate un file che a quanto  pare non avete caricato, potrebbe essere una svista da parte dell&lsquo;utente  oppure un vero e proprio bug dell&lsquo;applicazione. La soluzione in questo  caso &egrave; contattare l&lsquo;amministratore di sistema o il responsabile del  pacchetto.</p>','','4','0','2010-11-13 16:15:00','0000-00-00 00:00:00','0',',1,2,','nessun_file_e_stato_caricato','4','1.1.4','','');
INSERT INTO `dynarc_gnujikoalerts_items` VALUES('5','1','0','444','2','0','0','Manca la cartella temporanea','<p>Quando si carica un file il sistema lo salva su una cartella temporanea prima di spostarlo nella destinazione prestabilita.<br />Qualcosa &egrave; andato storto e potrebbe derivare dalla configurazione del PHP.<br />Contattare l&lsquo;amministratore di sistema.</p>','','5','0','2010-11-13 16:29:00','0000-00-00 00:00:00','0',',1,2,','manca_la_cartella_temporanea','5','1.1.5','','');
INSERT INTO `dynarc_gnujikoalerts_items` VALUES('6','1','0','444','2','0','0','Impossibile salvare il file','<p>Probabilmente non si ha i permessi in scrittura sulla cartella  temporanea in cui il sistema salva il i file prima di spostarli nella  destinazione prestabilita. Contattare l&lsquo;amministratore di sistema che  provveder&agrave; a correggere i permessi.<br />Pu&ograve; capitare a volte che questo errore si manifesti nel caso non si abbia sufficiente spazio su disco.</p>','','6','0','2010-11-13 16:32:00','0000-00-00 00:00:00','0',',1,2,','impossibile_salvare_il_file','6','1.1.6','','');
INSERT INTO `dynarc_gnujikoalerts_items` VALUES('7','1','0','444','2','0','0','Tipo di file non valido','<p>Avete caricato un tipo di file che al sistema non piace.</p><p>Per  motivi di sicurezza, virus, e quant&lsquo;altro, il sistema potrebbe essere  configurato per fare in modo che non ci sia la possibilit&agrave; di caricare  file catalogati come &quot;dannosi&quot;. Come ad esempio. file eseguibili (.exe),  script (.php), ecc.<br />Anche in questo caso bisogna mettere mano al  file di configurazione di PHP quindi &egrave; necessario contattare  l&lsquo;amministratore di sistema.</p>','','7','0','2010-11-13 16:37:00','0000-00-00 00:00:00','0',',1,2,','tipo_di_file_non_valido','7','1.1.7','','');
INSERT INTO `dynarc_gnujikoalerts_items` VALUES('8','1','0','444','10','0','0','Tipo di file non valido','<p>Dynarc, il gestore di archivi dinamici, importa solamente file di tipo XML e ZIP.</p>','','1','0','2010-11-13 18:07:00','0000-00-00 00:00:00','0',',4,7,8,9,10,','tipo_di_file_non_valido','1','3.3-dynarc-1.1.1','','');
