CREATE TABLE `dynarc_printmodels_items` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `gid` int(11) NOT NULL,
  `_mod` varchar(3) NOT NULL,
  `cat_id` int(11) NOT NULL,
  `lnk_id` int(11) NOT NULL,
  `lnkarc_id` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `description` longtext NOT NULL,
  `keywords` varchar(255) NOT NULL,
  `ordering` int(11) NOT NULL,
  `trash` tinyint(1) NOT NULL,
  `ctime` datetime NOT NULL,
  `mtime` datetime NOT NULL,
  `published` tinyint(1) NOT NULL,
  `hierarchy` varchar(255) NOT NULL,
  `aliasname` varchar(255) NOT NULL,
  `code_num` int(11) NOT NULL,
  `code_str` varchar(32) NOT NULL,
  `code_ext` varchar(3) NOT NULL,
  `md5` varchar(32) NOT NULL,
  `thumbdata` longtext NOT NULL,
  `format` varchar(10) NOT NULL,
  `firstpage_content` longtext NOT NULL,
  `lastpage_content` longtext NOT NULL,
  `orientation` varchar(1) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`,`gid`,`_mod`,`cat_id`,`ordering`,`trash`,`published`,`keywords`,`aliasname`,`code_num`,`code_str`,`code_ext`)
) ENGINE=MyISAM AUTO_INCREMENT=46 DEFAULT CHARSET=latin1;

