INSERT INTO `dynarc_todo_items` VALUES('1','2','1','660','0','0','0','Contribuire al progetto Gnujiko','<p><span style="font-size: small;"><strong>Ti chiediamo un piccolo contributo</strong></span></p> <p><span style="font-size: small;">Gnujiko  &egrave; sviluppato da programmatori volontari che giornalmente ampliano di  funzionalit&agrave; e migliorano questo software per permettere a tutti di  avere uno strumento semplice ma al tempo stesso completo per la gestione  di una piccola impresa o per diventare parte integrante di realt&agrave; pi&ugrave;  complesse.</span></p> <p><span style="font-size: small;">In questo  momento di crisi che sta investendo un po tutta l&lsquo;Italia e non solo ci  sentiamo di dare il nostro contributo a tutte quelle piccole imprese e  aziende che desiderano rinnovarsi offrendo questo prodotto e la nostra  esperienza nel campo delle applicazioni gestionali.</span></p> <p><span style="font-size: small;">Pertanto  se ti &egrave; piaciuto il nostro software e lo hai trovato utile ed adeguato  alle tue esigienze ti chiediamo un piccolo contributo, una donazione  libera, decidi tu quanto, cos&igrave; da permetterci con il vostro aiuto di far  fronte alle spese di gestione per il mantenimento del software  aggiornato e dei canali di supporto.</span></p> <p><span style="font-size: small;">Grazie per il tuo contributo.</span></p> <p><span style="font-size: small;">  </span></p> <p><a href="http://gnujiko.alpatech.it/it/support/index.php" target="_blank" style="font-size:14px">Fai una donazione!</a></p>','','1','0','2013-06-19 17:42:09','2014-12-18 00:12:22','0',',','0','0','0000-00-00 00:00:00','0000-00-00 00:00:00','0');
