DROP TABLE IF EXISTS `gnujiko_services`;

CREATE TABLE `gnujiko_services` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `gid` int(11) NOT NULL,
  `_mod` varchar(3) NOT NULL,
  `name` varchar(64) NOT NULL,
  `description` varchar(255) NOT NULL,
  `command` text NOT NULL,
  `oneshot` tinyint(1) NOT NULL,
  `enabled` tinyint(1) NOT NULL,
  `last_exec` date NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  KEY `uid` (`uid`,`gid`,`_mod`,`name`,`enabled`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `gnujiko_session`;

CREATE TABLE `gnujiko_session` (
  `uname` varchar(40) DEFAULT NULL,
  `login_time` varchar(14) NOT NULL,
  `time` varchar(14) DEFAULT '',
  `session_id` varchar(32) NOT NULL DEFAULT '0',
  `uid` int(11) DEFAULT '0',
  `gid` int(11) NOT NULL,
  `dev` varchar(32) NOT NULL,
  `devid` varchar(32) NOT NULL,
  PRIMARY KEY (`session_id`),
  KEY `dev` (`dev`),
  KEY `devid` (`devid`),
  KEY `login_time` (`login_time`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `gnujiko_stats_services`;

CREATE TABLE `gnujiko_stats_services` (
  `service` varchar(64) NOT NULL,
  `enabled` tinyint(1) NOT NULL,
  PRIMARY KEY (`service`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

