DROP TABLE IF EXISTS `gnujiko_user_privileges`;

CREATE TABLE `gnujiko_user_privileges` (
  `uid` int(11) NOT NULL,
  `mkdir_enable` tinyint(1) NOT NULL,
  `edit_account_info` tinyint(1) NOT NULL,
  `run_sudo_commands` tinyint(1) NOT NULL,
  PRIMARY KEY (`uid`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

